type SetPropsType = {
  id: number;
  bas_dd: number;
  mkt_nm: string;
  isu_nm: string;
  acc_trdvol: number;
  mktcap: number;
  tdd_opnprc: number;
}
class StockInformationModel {
  private id: number;
  private bas_dd: number;
  private mkt_nm: string;
  private isu_nm: string;
  private acc_trdvol: number;
  private mktcap: number;
  private tdd_opnprc: number;

  constructor() {
    this.id = 0;
    this.bas_dd = 0;
    this.mkt_nm = "";
    this.isu_nm = "";
    this.acc_trdvol = 0;
    this.mktcap = 0;
    this.tdd_opnprc = 0;
  }

  set(item: SetPropsType) {
    this.id = item.id;
    this.bas_dd = item.bas_dd;
    this.mkt_nm = item.mkt_nm;
    this.isu_nm = item.isu_nm;
    this.acc_trdvol = item.acc_trdvol;
    this.mktcap = item.mktcap;
    this.tdd_opnprc = item.tdd_opnprc;
  }

  get() {
    const item = {
        id: this.id,
        bas_dd: this.bas_dd,
        mkt_nm: this.mkt_nm,
        isu_nm: this.isu_nm,
        acc_trdvol: this.acc_trdvol,
        mktcap: this.mktcap,
        tdd_opnprc: this.tdd_opnprc,
    }
    return item;
  }
}

export default StockInformationModel;
